import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Welcome.css';

const Welcome = ({ username, onLogout }) => {
  const [dropdownVisible, setDropdownVisible] = useState(false);
  const [step, setStep] = useState(0); // Step tracker for the form
  const [formData, setFormData] = useState({
    cad1File: null,
    cad2File: null,
    params: '',
    otherFiles: []
  });
  const navigate = useNavigate();

  const handleDropdownToggle = () => {
    setDropdownVisible(!dropdownVisible);
  };

  const handleChangePassword = () => {
    navigate('/changepassword');
  };

  const handleDeleteUser = () => {
    navigate('/deleteUser');
  };

  const handleGadenClick = () => {
    setStep(1); // Move to the next step (CAD 1 file)
  };

  const handleFileInputChange = (event, field) => {
    const file = event.target.files[0];
    setFormData({
      ...formData,
      [field]: file
    });
  };

  const handleParamsChange = (event) => {
    const value = event.target.value;
    setFormData({
      ...formData,
      params: value
    });
  };

  const handleOtherFilesChange = (event) => {
    const files = event.target.files;
    setFormData({
      ...formData,
      otherFiles: [...formData.otherFiles, ...files]
    });
  };

  const handleSubmit = () => {
    // Handle form submission (e.g., send data to backend)
    console.log(formData);
    // Reset form state
    setStep(0);
    setFormData({
      cad1File: null,
      cad2File: null,
      params: '',
      otherFiles: []
    });
  };

  const renderFormStep = () => {
    switch (step) {
      case 1:
        return (
          <div className="file-input-form">
            <label>CAD 1 File:</label>
            <input type="file" onChange={(e) => handleFileInputChange(e, 'cad1File')} />
            <button onClick={() => setStep(2)}>Next</button>
          </div>
        );
      case 2:
        return (
          <div className="file-input-form">
            <label>CAD 2 File:</label>
            <input type="file" onChange={(e) => handleFileInputChange(e, 'cad2File')} />
            <button onClick={() => setStep(3)}>Next</button>
          </div>
        );
      case 3:
        return (
          <div className="param-input-form">
            <label>Parameters:</label>
            <textarea value={formData.params} onChange={handleParamsChange} />
            <button onClick={() => setStep(4)}>Next</button>
          </div>
        );
      case 4:
        return (
          <div className="file-input-form">
            <label>Other Files:</label>
            <input type="file" multiple onChange={handleOtherFilesChange} />
            <button onClick={handleSubmit}>Submit</button>
          </div>
        );
      default:
        return null;
    }
  };

  return (
    <div className="welcome-container">
      <div className="welcome-banner">
        <span className="username" onClick={handleDropdownToggle}>Hi {username}!</span>
        {dropdownVisible && (
          <div className="dropdown-menu">
            <button onClick={handleChangePassword}>Change Password</button>
            <button onClick={handleDeleteUser}>Delete User</button>
          </div>
        )}
        <button onClick={onLogout}>Logout</button>
      </div>
      <div className="main-content">
        {step === 0 && (
          <button className="gaden-button" onClick={handleGadenClick}>Gaden</button>
        )}
        {step !== 0 && (
          <div className="form-container">
            {renderFormStep()}
          </div>
        )}
      </div>
    </div>
  );
};

export default Welcome;
